import React, { Component } from 'react';
import data from '../../assets/data.json';

class MainClass extends Component {
  constructor(props) {
    super();
    this.state = {
      data: []
    }
  }

  isVinyasa() {
    let arr = [];
    let vin = JSON.stringify(data.classes);
    for (let i = 0; i < vin.length; i++) {
      if (vin[i] === 'vinyasa') {
        arr.push(vin[i])
      }
    }
    return arr;
  }

  render() {
    return (
      <div>
        <p><a href="#">{this.isVinyasa()}</a></p>
        {/* <p>{JSON.stringify(data.classes[1].title)}</p> */}
        {/* <p>{this.state.data.push(data.classes[0])}</p>
        <p>{JSON.stringify(this.state.data)}</p> */}
      </div>
    )
  }
}

export default MainClass;
